  </Figure.Caption>
                <Figure.Image className='figureImageFive'
                    width={171}
                    height={180}
                    alt="giveUsATry"
                    src={giveUsATry}
                />
                <Figure.Caption className='figureCaptionFive'>
                    Nulla vitae elit libero, a pharetra augue mollis interdum.
  </Figure.Caption>
                <Figure.Image className='figureImageSix'
                    width={171}
                    height={180}
                    alt="becomeMember"
                    src={becomeMember}
                />
                <Figure.Caption className='figureCaptionSix'>
                    Nulla vitae elit libero, a pharetra augue mollis interdum.
  </Figure.Caption>
            </Figure>
        </div>
    )

}

export default Figures
